import React from 'react';
import {Row, Col, Container} from 'react-bootstrap';
const BoxFeature = () =>{
    return(
        <Container>
        <Row>
            <Col sm={8}>
                sm = 8
            </Col>
            <Col sm={4}>sm = 4</Col>
        </Row>
        </Container>
    )
}

export default BoxFeature;
